Our experiments and analysis so far use T5-Large as the backbone model. To verify whether the performance gain of MPT is consistent across different backbone models, we extend the experiments to T5-Base, T5-XLarge, BART-Large and GPT2-Large in the NP→→\rightarrowP setting. From the results shown in Table 5, we can see that MPT still outperforms PT and MTL by a large margin when using other PLMs as the backbone model, showing its robustness to model size and type. In addition, the consistent gain of MPT with T5-XLarge could also verify the effectiveness of MPT for huge PLMs which have been shown to perform better in prompt tuning (Lester et al., 2021).
